import styles from "./LocationItem.module.css";
import Link from "next/link";

export default ({ img, id }) => (
  <Link href="/location/[id]" as={`/location/${id}`}>
    <a className={styles.link}>
      <div className={styles.card}>
        <img src={`/locations/${img}.jpg`} />
        <div className={styles.info}>
          <h3 className={styles.title}>Earth (C-137)</h3>
          <p className={styles.description}>Planet</p>
        </div>
      </div>
    </a>
  </Link>
);
